import { Container, Grid } from "@mui/material";

import FilterProvider from "./context/FilterContext";
import ExlReader from "./container/ExlReader";
import Filter from "./container/Filter";

const App = () => {
	return (
		<>
			<FilterProvider>
				<Grid container spacing={2}>
					<Grid item xs={2}>
						<Filter />
					</Grid>
					<Grid item xs={10}>
						<ExlReader />
					</Grid>
				</Grid>
			</FilterProvider>
		</>
	);
};

export default App;
